import Login from './learningPages/Login.js';
import './CSS/Login.css'
function App() {
  return (
    <div style={adjust} className='notice'>
     <span className='headline'><h1><b></b>Welcome to <br></br>
        Crystal delta<br></br> e-learning</h1></span>
      <Login/>
    </div>
  );
}

export default App;

const adjust={
  top:'20%',
  left:'20%'
}
